import React, { useEffect, useState } from "react";
import axios from "axios";
import "./App.css";

const App = () => {
  const [student, setStudent] = useState([]);
  const loadStudent = async () => {
    await axios
      .get("http://localhost:5000/api/getInfo?page=1&size=10")
      .then(({ data }) => {
        const allStudent = [];
        data.forEach((s) => {
          allStudent.push({ name: s.email, email: s.name });
        });
        setStudent(allStudent);
      });
  };
  useEffect(() => {
    loadStudent();
  }, []);
  return (
    <div>
      {student.map((p) => {
        return <div key={Math.random() * 200 + 1}>{p.name}</div>;
      })}
    </div>
  );
};

export default App;
